import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/images/logo.png'; // Update the logo path

const Header = () => {
  return (
    <header className="bg-ewaste-green p-4">
      <div className="container mx-auto flex items-center justify-between">
        <img src={logo} alt="E-Waste Logo" className="h-10" />
        <nav>
          <Link to="/" className="text-white mx-4">Home</Link>
          <Link to="/login" className="text-white mx-4">Login</Link>
          <Link to="/register" className="text-white mx-4">Register</Link>
          <Link to="/account" className="text-white mx-4">Account</Link>
        </nav>
      </div>
    </header>
  );
};

export default Header;
